import React, { Component } from 'react';
import TopNavLeftIcon from './TopNavLiftIcon';



class TopNavLeft extends Component {
    constructor() {
        super()
        this.state = {
            LeftIcon : [
        {id:1,  className:"fab fa-facebook-f",   href:"https://www.facebook.com/",  title:"Facebook"},
        {id:2,  className:"fab fa-google-plus-g",       href:"https://plus.google.com/",   title:"Google+"},
        {id:3,  className:"fab fa-twitter",             href: "https://twitter.com",       title:"Twitter"},
        {id:4,  className:"fab fa-linkedin-in",         href:"https://www.linkedin.com",   title:"LinkedIn"},
        {id:5,  className:"fab fa-instagram",           href:"https://www.instagram.com",  title:"instagram"},
        ]
        }
    }
     
    mapping(x) {
        const members=x.map(member =>
        <TopNavLeftIcon
            key={member.id}
            className={member.className}
            href={member.href}
            title={member.title}
        />
        );
        return(members)
    }
        
    render() {
         return (
        <div className=" col-lg-6 col-md-6 col-sm-12 col-xs-12">
            <ul className="list-inline hover-red">
                <li>
                    {this.mapping(this.state.LeftIcon)}
                </li>
            </ul>
        </div>
    );
    }
   
}
export default TopNavLeft;
